void poly_pointwise(uint16_t* a, uint16_t* b, uint16_t* c, int dim)
{

	int i;
	for (i = 0; i < dim; i++)
		c[i] = a[i] * b[i] % Q;

}
/*---------------------------------------------------
 Input: polynomial a
 Output: polynomial a in dimTT domain
 ------------------------------------------------------*/
void poly_ntt(uint16_t* r, int dim)
{
	uint16_t m, i, j, j_1, V, t, U, j_2;
	t = dim;
	for (m = 1; m < dim; m = 2 * m)
	{
		t = t / 2;
		for (i = 0; i < m; i++)
		{
			j_1 = 2 * i * t;
			j_2 = j_1 + t - 1;
			for (j = j_1; j <= j_2; j++)
			{
				U = r[j] % Q;
				V = r[j + t] * phi[m + i] % Q;
				r[j] = (U + V) % Q;
				r[j + t] = (U - V + 4 * Q) % Q;
			}

		}
	}
	// poly_bitrev(r);

}


void poly_invntt(uint16_t* r, int dim, int inv_n)

{
	// poly_bitrev(r);
	uint16_t t, m, h, i, j, j_1, j_2, S, U, V;
	t = 1;
	for (m = dim; m > 1; m = m / 2)
	{
		j_1 = 0;
		h = m / 2;
		for (i = 0; i < h; i++)
		{
			j_2 = j_1 + t - 1;
			S = invphi[h + i];
			for (j = j_1; j <= j_2; j++)
			{

				U = r[j] % Q;
				V = r[j + t] % Q;
				r[j] = (U + V) % Q;
				r[j + t] = ((U - V + 4 * Q) * S) % Q;
			}
			j_1 = j_1 + 2 * t;

		}
		t = 2 * t;
	}

	for (j = 0; j < dim; j++)
		r[j] = (r[j] * inv_n) % Q;


}

static void pol_naivemul(uint16_t* c, uint16_t* a, uint16_t* b)
{
	int i, j;
	uint16_t r[2 * N];

	for (i = 0; i < 2 * N; i++)
		r[i] = 0;

	for (i = 0; i < N; i++)
		for (j = 0; j < N; j++)
		{
			r[i + j] += a[i] * b[j] % Q;
			r[i + j] %= Q;
		}

	for (i = N; i < 2 * N - 1; i++) {
		r[i - N] = r[i - N] + Q - r[i];
		r[i - N] %= Q;
	}

	for (i = 0; i < N; i++)
		c[i] = r[i];
}



//zhou 1 round
void  poly_1ptntt(uint16_t* f, uint16_t* g, uint16_t* h, int dim, int inv_n)

{
	uint16_t f_even[N / 2], f_odd[N / 2], g_even[N / 2], g_odd[N / 2], g_odd_1[N / 2], fg_even[N / 2], fg_odd[N / 2], fg_odd_1[N / 2], fg_eo[N / 2], fg_oe[N / 2], h_even[N / 2], h_odd[N / 2];
	int i;

	//f[dim]
	for (i = 0; i < dim; i++)

	{

		f_even[i] = f[2 * i];
		f_odd[i] = f[2 * i + 1];
		g_even[i] = g[2 * i];
		g_odd[i] = g[2 * i + 1];
	}


	for (i = 1; i < dim; i++)
		g_odd_1[i] = g_odd[i - 1];
	g_odd_1[0] = -g_odd[dim - 1] + Q;

	poly_ntt(f_even, dim);
	poly_ntt(g_even, dim);
	poly_pointwise(f_even, g_even, fg_even, dim);


	poly_ntt(g_odd_1, dim);
	poly_ntt(f_odd, dim);
	poly_pointwise(f_odd, g_odd_1, fg_odd_1, dim);

	for (i = 0; i < dim; i++)
		h_even[i] = (fg_even[i] + fg_odd_1[i]) % Q;

	poly_invntt(h_even, dim, inv_n);


	poly_pointwise(f_odd, g_even, fg_oe, dim);

	poly_ntt(g_odd, dim);
	poly_pointwise(f_even, g_odd, fg_eo, dim);


	for (i = 0; i < dim; i++)
		h_odd[i] = (fg_oe[i] + fg_eo[i]) % Q;

	poly_invntt(h_odd, dim, inv_n);
	for (i = 0; i < dim; i++)
	{

		h[2 * i] = h_even[i];
		h[2 * i + 1] = h_odd[i];

	}

}

